les on mystery girl, no pierced nipples on Kate.<br>Pierced tongue on mystery girl, no pierced tongue on Kate.<br>Almost all of Kate&#39;s videos are filmed in front of a specific background, mystery girl seems to be in a hotel.<br>Yesterday I found hundreds of Kate vids going back to late 2012 with thumbnail sheets.  I scanned through the thumbnail sheets and didn&#39;t see a single one that matched anything from the mystery girl pics: no similar toys, no similar backgrounds, etc...<br>Most of the Kate videos I found online were created after the date that this thread was even posted... only a handful of videos were even recorded before the original posting date of this thread.<br>A vast majority of Kate&#39;s videos are either solo or girl/girl only... the person in the mystery girl gifs clearly has a man with her that is guiding the giant dildo into her.<br><br>Simple way to solve the above part of the mysetery:<br>Someone with a twitter account should just directly tweet awesomekate (she seems pretty accessible via twitter) and ask flat out if it&#39;s her.  I would do it myself but I don&#39;t have a twitter and have no desire to make one lol.<br><br>Possible reason for the difficulty in finding OP sauce:<br>I noticed while Google reverse image searching and trying some different search terms with the pictures (awesomekate, dildo, huge dildo, etc...), that some (but not all) of the pictures triggered a warning at the bottom of the google results saying that some results were hidden because of possible child abuse imagery.  Now, I highly doubt that mystery girl is underage - maybe I&#39;m naive, but I can&#39;t imagine there&#39;s a lot of underage girls that enthusiastically and excitedly attempt to fuck dildos that are the length and thickness of a human arm - but maybe it was originally posted on a site that also housed CP or some shit, and maybe that&#39;s why it&#39;s impossible to find now.<br><br>:-(   </blockquote>    				 </td> </tr> </tbody> </table>  